import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import OnboardingSwiper from './src/components/OnboardingSwiper'
import Calendar from './src/modules/calendar/Calendar'

const Stack = createStackNavigator();
//#A6CA94
const theme = {
  dark: false,
  roundness: '10',
  colors: {
    primary: '#9FC5B1', //primary color for your app, usually your brand color
    accent: '#9EC1DB', //secondary color for your app which complements the primary color
    background: '#DCE5D7', //background color for pages, such as lists
    surface: '#D9EDDF', // background color for elements containing content, such as cards
    text: '#fff', //text color for content
  }
}

function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="Onboarding" component={OnboardingSwiper} />
        <Stack.Screen name="Calendar" component={Calendar} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

export default App;
